    def __init__(self, key: int, value):
        self.key = key
        self.value = value
        self.pre = None
        self.nxt = None


class LRUCache2(object):
    def __init__(self, capacity: int):
        if capacity < 1:
            raise ValueError
        self.capacity = capacity
        self.head = LRUNode(-1, None)
        self.tail = LRUNode(-1, None)
        self.head.nxt = self.tail
        self.tail.pre = self.head
        self.nodes = {}

    def move_to_end(self, node: LRUNode) -> None:
        if node.nxt is self.tail:
            return
        node.pre.nxt = node.nxt
        node.nxt.pre = node.pre
        self.append(node)

    def append(self, node: LRUNode) -> None:
        precursor = self.tail.pre
        precursor.nxt = node
        node.pre = precursor
        self.tail.pre = node
        node.nxt = self.tail

    def pop_first(self) -> LRUNode:
        if len(self.nodes) <= 0:
            raise RuntimeError
        node = self.head.nxt
        node.pre.nxt = node.nxt
        node.nxt.pre = node.pre
        node.pre = None
        node.nxt = None
        self.nodes.pop(node.key)
        return node

    def get(self, key: int):
        if key not in self.nodes:
            return None
        node = self.nodes[key]
        self.move_to_end(node)
        return node.value

    def put(self, key: int, value) -> None:
        if key in self.nodes:
            node = self.nodes[key]
            node.value = value
            self.move_to_end(node)
        else:
            node = LRUNode(key, value)
            self.append(node)
            self.nodes[key] = node
            if len(self.nodes) > self.capacity:
                self.pop_first()
