    def __init__(self, key: int, value):
        self.key = key
        self.value = value
        self.freq = 1
        self.pre = None
        self.nxt = None


class LFUList(object):
    def __init__(self):
        self.head = LFUNode(-1, None)
        self.tail = LFUNode(-1, None)
        self.head.nxt = self.tail
        self.tail.pre = self.head

    def append(self, node: LFUNode) -> None:
        precursor = self.tail.pre
        precursor.nxt = node
        node.pre = precursor
        self.tail.pre = node
        node.nxt = self.tail

    def is_empty(self):
        return self.head.nxt is self.tail

    def pop_first(self) -> LFUNode:
        if self.is_empty():
            raise RuntimeError
        node = self.head.nxt
        node.pre.nxt = node.nxt
        node.nxt.pre = node.pre
        node.pre = None
        node.nxt = None
        return node


class LFUCache(object):
    def __init__(self, capacity: int):
        if capacity < 1:
            raise ValueError
        self.capacity = capacity
        self.nodes = {}
        self.lists = defaultdict(LFUList)
        self.least_freq = 0

    def _touch(self, node: LFUNode) -> None:
        node.pre.nxt = node.nxt
        node.nxt.pre = node.pre
        node.pre = node.nxt = None
        if self.lists[node.freq].is_empty() and self.least_freq == node.freq:
            self.least_freq += 1
        node.freq += 1
        self.lists[node.freq].append(node)

    def get(self, key: int):
        if key not in self.nodes:
            return None
        node = self.nodes[key]
        self._touch(node)
        return node.value

    def put(self, key: int, value) -> None:
        if key in self.nodes:
            node = self.nodes[key]
            self._touch(node)
            node.value = value
        else:
            if len(self.nodes) >= self.capacity:
                obsolete = self.lists[self.least_freq].pop_first()
                self.nodes.pop(obsolete.key)
            self.least_freq = 1
            node = LFUNode(key, value)
            self.nodes[key] = node
            self.lists[1].append(node)
